import React from "react";

function SearchInput() {
  return (
    <div>
      <input
        type="text"
        className=" mb-3 mt-3 text-xl p-2 rounded-full py-3 px-10 input"
        placeholder="Search..."
      />
    </div>
  );
}

export default SearchInput;
